import Helmet from "../components/Helmet/Helmet";
import {Container, Row, Col} from "reactstrap";

import hero_img from '../assets/images/hero.png'
const Home = () => {

    return (
        <Helmet title='Home'>
            <section>
                <Container>
                    <Row>
                        <Col lg='6' md='6'>
                            <div className="hero_content">
                                <h5>Простой способ сделать заказ</h5>
                            </div>
                        </Col>
                        <Col lg='6' md='6'>
                            <div className="hero_img">
                                <img src={hero_img} alt = 'hero img'/>
                            </div>
                        </Col>

                    </Row>
                </Container>
            </section>
        </Helmet>

    );
}

export default Home;
